cmp(&lhs) as opposed to lhs.partial_cmp(&rhs). This is making Rust reverse the order relation between the two values as discussed above. The & and .unwrap() in the above code is Rust specific and is not particularly relevant to our algorithm, just necessary minutiae to make the code compile. We again provide a test to double-check that our code works as expected. #[test] fn angle_sort() { let mut rays = vec![Point { x: 1.0, y: 1.0 }, Point { x: 0.0, y: 1.0 }, Point { x: 2.0, y: 4.0 }, Point { x: -1.0, y: 1.0 }, Point { x: 1.0, y: 0.2 } ]; Point::sort_from_angle(&mut rays, Point { x: 1.0, y: 0.0 }); assert_eq!(rays, vec![Point { x: 1.0, y: 0.2 }, Point { x: 1.0, y: 1.0 }, Point { x: 2.0, y: 4.0 }, Point { x: 0.0, y: 1.0 }, Point { x: -1.0, y: 1.0 }]); } Applying this code to our generate_line_of_sight algorithm is as simple as calling our associated sorting function. # use super::space::{Point, Segment, Triangle};
